import React from 'react';
import "./Landing.scss";

import "../../components/Hero/Hero";

export default function Landing() {
  return (
    <section className="page">
        <section className="hero">
            <h2>I'm Axel Holmqvist.</h2>
            <h1>A digital designer.</h1>
        </section>
    </section>
  );
}
